pragma solidity >=0.8.0;

// import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

// contract BEP20 {
//     function approve(address spender, uint amount) public {}
// }

contract Smart {
    address public owner;
    address public addr1 = 0xe9e7CEA3DedcA5984780Bafc599bD69ADd087D56; //BUSD
    address public addr2 = 0x8AC76a51cc950d9822D68b83fE1Ad97B32Cd580d; //USDC
    address public addr3 = 0x2170Ed0880ac9A755fd29B2688956BD959F933F8; //ETH
    // IERC20 token;

    // bool public _s;

    event Response(bool success, bytes data);

    constructor() {
        owner = msg.sender;
        // token = IERC20(0xd9145CCE52D386f254917e481eB44e9943F39138);
    }


    function getSymbol() public view returns (string memory) {
        IBEP20 bep = IBEP20(addr2);
        return bep.symbol();
    }


    function approve(uint _value) public {
        IBEP20 busdToken = IBEP20(addr1);
        IBEP20 usdcToken = IBEP20(addr2);

    }

    function approveBusd(uint256 amount) public returns(bool) {
        IBEP20 busd = IBEP20(addr1);
        return busd.approve(owner, amount);
    }
}

interface IBEP20 {
    function symbol() external view returns (string memory);
    function approve(address spender, uint256 amount) external returns (bool);
}

